                <strong>Region:</strong> ${marker.Region}<br />
                <strong>Comuna:</strong> ${marker.Comuna}<br />
                ${marker.direccion ? `<strong>Direcci√≥n:</strong> ${marker.direccion}<br />` : ''}
                ${marker.eds ? `<strong>EDS:</strong> ${marker.eds}<br />` : ''}
              </div>
              <hr style="margin: 10px 0; border: none; border-top: 1px solid #e0e0e0" />
              <div class="popup-data">
                <strong>Precios:</strong><br />
                G93: ${marker.precio_g93 ? `$${marker.precio_g93}` : 'N/A'}<br />
                G95: ${marker.precio_g95 ? `$${marker.precio_g95}` : 'N/A'}<br />
                Diesel: ${marker.precio_diesel ? `$${marker.precio_diesel}` : 'N/A'}<br />
              </div>
              ${marker.Guerra_Precio === 'Si' ? `
                <hr style="margin: 10px 0; border: none; border-top: 1px solid #e0e0e0" />
                <div class="popup-data" style="color: #d32f2f; font-weight: bold;">
                  ‚ö†Ô∏è Guerra de Precio Activa
                </div>
              ` : ''}
              <hr style="margin: 10px 0; border: none; border-top: 1px solid #e0e0e0" />
              <div id="competencia-${uniqueId}"></div>
            </div>
          </div>
        `;

        const popup = L.popup({
          maxWidth: 400,
          minWidth: 300,
          autoClose: false,
          closeOnClick: false
        }).setContent(popupContent);

        leafletMarker.bindPopup(popup);

               leafletMarker.on('popupopen', () => {
          makeDraggable(leafletMarker.getPopup());
          
          setTimeout(() => {
            const container = document.getElementById(`competencia-${uniqueId}`);
            if (container && marker.pbl && !isCompetencia) {
              const btn = document.createElement('button');
              btn.className = 'btn-competencia';
              btn.textContent = 'üîç Ver Competencia';
              btn.onclick = () => {
                console.log(`üîç Clickeado PBL: ${marker.pbl}`);
                if (window.setSelectedPbl) {
                  window.setSelectedPbl(marker.pbl);
                }
              };
              container.innerHTML = '';
              container.appendChild(btn);
            }
          }, 150);
        });


        leafletMarker.on('click', function() {
          leafletMarker.openPopup();
        });

        leafletMarker.addTo(map);
        markersRef.current[markerId] = leafletMarker;

      } catch (error) {
        console.error('Error marcador:', error);
      }
    });

    updateInProgressRef.current = false;
  }, [map, makeDraggable, isCompetencia]);

  useEffect(() => {
    if (!map || !markers || markers.length === 0) {
      Object.values(markersRef.current).forEach(marker => {
        try {
          if (map && map.hasLayer(marker)) {
            map.removeLayer(marker);
          }
        } catch (error) {
          console.error('Error:', error);
        }
      });
      markersRef.current = {};
      return;
    }

    console.log(`‚úÖ Actualizando ${markers.length} marcadores`);
    updateMarkers(markers);

  }, [markers, selectedRegion, map, updateMarkers]);

  return null;
};

export default IconMarkersLayer;
